import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";
import { Table, Input, Select } from "antd";
import { SearchOutlined } from "@ant-design/icons";

const { Option } = Select;

function App() {
  const [branches, setBranches] = useState([]);
  useEffect(() => {
    axios.get("/api/branches").then(({ data }) => setBranches(data));
  }, []);

  console.log(branches);

  function parseLabel(label) {
    let parsedLabel = "";
    for (let i = 0; i < label.length; i++) {
      if (i === 0) {
        parsedLabel += label.charAt(i).toUpper();
      } else if (label.charAt(i) == "_") {
      } else {
      }
    }
  }

  function getColumns() {
    let columns = [];
    if (branches.length) {
      Object.keys(branches[0]).forEach((key) => {
        columns.push({
          title: parseLabel(key),
          dataIndex: key,
          key: key,
        });
      });
    }
    return columns;
  }

  return (
    <div className="app">
      <h1>Branches</h1>
      <div className="searchContainer">
        <div className="citySearch">
          <label htmlFor="city">City: </label>
          <Select defaultValue="lucy" className="citySearchBar">
            <Option value="jack">Jack</Option>
            <Option value="lucy">Lucy</Option>
            <Option value="disabled" disabled>
              Disabled
            </Option>
            <Option value="Yiminghe">yiminghe</Option>
          </Select>
        </div>
        <Input
          size="large"
          placeholder="Search"
          className="searchBar"
          prefix={<SearchOutlined />}
        />
      </div>
      <Table columns={getColumns()} dataSource={[]} className="table" />
    </div>
  );
}

export default App;
